// src/Form.js
import React, { useState } from 'react';

const Form = () => {
  const [step, setStep] = useState(1);
  const [college, setCollege] = useState('');
  const [major, setMajor] = useState('');
  const [technicalBreadth, setTechnicalBreadth] = useState('');
  const [gradYear, setGradYear] = useState('');
  const [gradQuarter, setGradQuarter] = useState('');
  const [completedCourses, setCompletedCourses] = useState([]);
  const [courseSubject, setCourseSubject] = useState('');
  const [courseTitle, setCourseTitle] = useState('');
  const [timeStart, setTimeStart] = useState('');
  const [timeEnd, setTimeEnd] = useState('');
  const [maxUnits, setMaxUnits] = useState('');
  const [summerClasses, setSummerClasses] = useState('');

  const handleAddCourse = () => {
    if (courseSubject && courseTitle) {
      setCompletedCourses([...completedCourses, { subject: courseSubject, title: courseTitle }]);
      setCourseSubject('');
      setCourseTitle('');
    }
  };

  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">Multi-Step Form</h1>

      {/* Step 1 */}
      {step === 1 && (
        <div className="mb-6">
          <h2 className="text-xl font-semibold mb-4">Step 1: Select Your Major(s)</h2>

          <div className="mb-4">
            <button
              type="button"
              className="bg-blue-500 text-white px-4 py-2 rounded"
              onClick={() => setStep(2)}
            >
              Add a Major
            </button>
          </div>

          <div className="mb-4">
            <label className="block mb-2">Select College</label>
            <select
              className="block w-full border border-gray-300 rounded p-2"
              value={college}
              onChange={(e) => {
                setCollege(e.target.value);
                if (e.target.value !== 'College of Engineering') {
                  setTechnicalBreadth('');
                }
              }}
            >
              <option value="">Select a College</option>
              <option value="College of Engineering">College of Engineering</option>
              <option value="College of Arts and Sciences">College of Arts and Sciences</option>
            </select>
          </div>

          {college === 'College of Engineering' && (
            <div className="mb-4">
              <label className="block mb-2">Technical Breadth Choice</label>
              <input
                type="text"
                className="block w-full border border-gray-300 rounded p-2"
                value={technicalBreadth}
                onChange={(e) => setTechnicalBreadth(e.target.value)}
              />
            </div>
          )}

          <div className="mb-4">
            <label className="block mb-2">Select Major</label>
            <input
              type="text"
              className="block w-full border border-gray-300 rounded p-2"
              value={major}
              onChange={(e) => setMajor(e.target.value)}
            />
          </div>

          <button
            type="button"
            className="bg-blue-500 text-white px-4 py-2 rounded"
            onClick={() => setStep(2)}
          >
            Next
          </button>
        </div>
      )}

      {/* Step 2 */}
      {step === 2 && (
        <div className="mb-6">
          <h2 className="text-xl font-semibold mb-4">Step 2: Target Graduation Date</h2>

          <div className="mb-4">
            <label className="block mb-2">Select Graduation Year</label>
            <select
              className="block w-full border border-gray-300 rounded p-2"
              value={gradYear}
              onChange={(e) => setGradYear(e.target.value)}
            >
              <option value="">Select Year</option>
              {Array.from({ length: 10 }, (_, i) => new Date().getFullYear() + i).map(year => (
                <option key={year} value={year}>{year}</option>
              ))}
            </select>
          </div>

          <div className="mb-4">
            <label className="block mb-2">Select Graduation Quarter</label>
            <select
              className="block w-full border border-gray-300 rounded p-2"
              value={gradQuarter}
              onChange={(e) => setGradQuarter(e.target.value)}
            >
              <option value="">Select Quarter</option>
              <option value="Fall">Fall</option>
              <option value="Winter">Winter</option>
              <option value="Spring">Spring</option>
              <option value="Summer">Summer</option>
            </select>
          </div>

          <button
            type="button"
            className="bg-blue-500 text-white px-4 py-2 rounded"
            onClick={() => setStep(3)}
          >
            Next
          </button>
        </div>
      )}

      {/* Step 3 */}
      {step === 3 && (
        <div className="mb-6">
          <h2 className="text-xl font-semibold mb-4">Step 3: Courses Completed So Far</h2>

          <div className="mb-4">
            <label className="block mb-2">Subject Area</label>
            <input
              type="text"
              className="block w-full border border-gray-300 rounded p-2"
              value={courseSubject}
              onChange={(e) => setCourseSubject(e.target.value)}
            />
          </div>

          <div className="mb-4">
            <label className="block mb-2">Course Title</label>
            <input
              type="text"
              className="block w-full border border-gray-300 rounded p-2"
              value={courseTitle}
              onChange={(e) => setCourseTitle(e.target.value)}
            />
          </div>

          <button
            type="button"
            className="bg-blue-500 text-white px-4 py-2 rounded"
            onClick={handleAddCourse}
          >
            Add Course
          </button>

          <ul className="mt-4">
            {completedCourses.map((course, index) => (
              <li key={index} className="border-b py-2">
                {course.subject} - {course.title}
              </li>
            ))}
          </ul>

          <button
            type="button"
            className="bg-blue-500 text-white px-4 py-2 rounded mt-4"
            onClick={() => setStep(4)}
          >
            Next
          </button>
        </div>
      )}

      {/* Step 4 */}
      {step === 4 && (
        <div className="mb-6">
          <h2 className="text-xl font-semibold mb-4">Step 4: Personal Preferences</h2>

          <div className="mb-4">
            <label className="block mb-2">Start Time</label>
            <input
              type="time"
              className="block w-full border border-gray-300 rounded p-2"
              value={timeStart}
              onChange={(e) => setTimeStart(e.target.value)}
            />
          </div>

          <div className="mb-4">
            <label className="block mb-2">End Time</label>
            <input
              type="time"
              className="block w-full border border-gray-300 rounded p-2"
              value={timeEnd}
              onChange={(e) => setTimeEnd(e.target.value)}
            />
          </div>

          <div className="mb-4">
            <label className="block mb-2">Max Course Load Units/Quarter</label>
            <select
              className="block w-full border border-gray-300 rounded p-2"
              value={maxUnits}
              onChange={(e) => setMaxUnits(e.target.value)}
            >
              <option value="">Select Units</option>
              {Array.from({ length: 20 }, (_, i) => i + 1).map(unit => (
                <option key={unit} value={unit}>{unit}</option>
              ))}
            </select>
          </div>

          <div className="mb-4">
            <label className="block mb-2">Summer Classes</label>
            <select
              className="block w-full border border-gray-300 rounded p-2"
              value={summerClasses}
              onChange={(e) => setSummerClasses(e.target.value)}
            >
              <option value="">Yes/No</option>
              <option value="Yes">Yes</option>
              <option value="No">No</option>
            </select>
          </div>

          <button
            type="button"
            className="bg-blue-500 text-white px-4 py-2 rounded"
            onClick={() => console.log('Form submitted')}
          >
            Submit
          </button>
        </div>
      )}
    </div>
  );
};

export default Forms;
